import { Component, OnInit } from "@angular/core";
import { MarketplaceApiService } from "src/app/core/marketplace-api/marketplace-api.service";
import { OfferModel } from "src/app/core/marketplace-api/models/offer.model";
import {MatDialog } from '@angular/material/dialog';
import { OfferCreationComponent } from "../offer-creation/offer-creation.component";

@Component({
  selector: "app-offer-list",
  templateUrl: "./offer-list.component.html",
  styleUrls: ["./offer-list.component.scss"],
})
export class OfferListComponent implements OnInit {
  pageSize = 10;
  page = 1;
  offers: OfferModel[] = [];
  total = 0;
  totalPages = 0;
  numbers: number[];
  pageIndex = 0;
  PageCount = 10


  constructor(public markeplaceApiService: MarketplaceApiService, public dialog:MatDialog) {}

  ngOnInit(): void {
    this.markeplaceApiService.getOffersCount().subscribe((data) => {
      this.total = data;
      this.totalPages = Math.round(this.total / this.pageSize);
      this.pageIndex = this.page
      this.numbers =  Array.from({length:this.PageCount},(v,k)=>k+1);
    });

    this.markeplaceApiService.getOffers(this.page, this.pageSize).subscribe({
      next: (offers: OfferModel[]) => {
        this.offers = offers;
      },
    });
  }

  getOffersPage(page:number,pageSize:number) {
    this.pageIndex =  page;
    this.markeplaceApiService.getOffers(page, pageSize).subscribe({
      next: (offers: OfferModel[]) => {
        this.offers = offers;
      },
    });
  }

  GetNextPageIndexes(page:number){
    if (this.numbers[page-1]=== this.totalPages) {
      return;
    }
    this.numbers = this.numbers.map(n => n + 1);
    this.pageIndex = this.numbers[page-1];
    this.getOffersPage(this.pageIndex,this.pageSize);
  }

  GetPreviousPageIndexes(){
    if (this.numbers[0]=== 1) {
      return;
    }
    this.numbers = this.numbers.map(n => n - 1);
    this.pageIndex =  this.numbers[0];
    this.getOffersPage(this.pageIndex,this.pageSize);
  }


  getFirstOffersPage(){
    if (this.numbers[0]=== 1) {
      return;
    }
    this.numbers =  Array.from({length:this.page},(v,k)=>k+1);
  }

  getLastOffersPage(){
    if (this.numbers[this.page-1]=== this.totalPages) {
      return;
    }
    const lastNumbers = this.totalPages - 10;
    this.getFirstOffersPage();
    this.numbers = this.numbers.map(n => n + lastNumbers);
  }

  openDialog(){
    this.dialog.open(OfferCreationComponent, {
      width: '400px',
      height:'600px'
    });
  }
}

<div class="container">
  <div class="row" >
    <div *ngFor="let offer of offers" class="col-lg-3 col-md-6 col-xs-12 pt-3">

      <app-offer [offer]="offer" class="w-100"></app-offer>
    </div>
  </div>
</div>
<div class="d-flex justify-content-center mt-4  ">
  <!-- <nav > -->
    <ul  class="pagination  pagination-lg pagination-sm" >
      <li class="page-item" (click)="getFirstOffersPage()">
        <a class="page-link">First</a>
      </li>
      <li class="page-item" (click)="GetPreviousPageIndexes()">
        <a class="page-link">Previous</a>
      </li>
      <div class="custom-pagination d-flex">
        <li class="page-item" [ngClass]="{'active':item === pageIndex }" (click)="getOffersPage(item, pageSize)" *ngFor="let item of numbers">
          <a class="page-link">{{item}}</a>
        </li>
      </div>
      <li class="page-item" (click)="GetNextPageIndexes(page)">
        <a class="page-link">Next</a>
      </li>
      <li class="page-item" (click)="getLastOffersPage()">
        <a class="page-link">Last</a>
      </li>
    </ul>
  <!-- </nav> -->
</div>
<div class="d-flex justify-content-center">
  <button mat-raised-button (click)="openDialog()">Add New Post</button>
</div>

